import React from 'react'
import styled from 'styled-components'
import { Title, H1 } from '../denuncie/Styled'


import Nome from './Nome'
import Email from './Email'
import Mensagem from './Mensagem'
import Button from './Button'
import svg from './img/Svg.png'

export default function Fale() {

  return (
    <Body>
        <Title>
          <H1>Contato</H1>
        </Title>

      <Form>
        <Nome/>

        <Email/> 

        <Mensagem/>
          
        <Button/>
        </Form>
        
        <Img>
          <img src={svg} alt='EmailSvg' />
          <p>Email para contato<br/>appgeni5@gmail.com</p>
        </Img>
    </Body>
  )
}

const Body = styled.body`
  width: 1000px;
  margin: 100px auto;
  background: #f2f2f2;
`

const Form = styled.form`
  width: 1000px;
  display: flex;
  margin: 0auto;
  flex-wrap: wrap;
`

const Img = styled.section`
  width: 230px;
  display: flex;
  margin: 0 auto;
  padding: 0 10px;
`
